import React from "react";
import {
  GalleryContainer,
  GalleryCarousel,
  GalleryCard,
  GalleryH1,
} from "./GalleryElements";

const Gallery = () => {
  return (
    <GalleryContainer>
      <GalleryH1>Image Gallery</GalleryH1>
      <GalleryCarousel>
        <GalleryCard>
          <GalleryImg />
          <GalleryImg />
          <GalleryImg />
        </GalleryCard>
      </GalleryCarousel>
    </GalleryContainer>
  );
};

export default Gallery;

// GalleryContainer, GalleryH1, GalleryCarousel, GalleryCard
